#define WIDTH 2
#define HEIGHT 2

float map[HEIGHT][WIDTH];

void initMap()
{
	for(int i = 0; i < HEIGHT; i++)
		for(int j = 0; j < WIDTH; j++)
		{
			map[i][j] = float(rand() % 201 /*- 100*/ ) / 200.0f;
		}
}

void printMap()
{
	for(int i = 0; i < HEIGHT; i++)
	{
		for(int j = 0; j < WIDTH; j++)
		{
			if(map[i][j] >= 0.0f)
				printf(" ");
			printf("%0.2f ", map[i][j]);
		}
		printf("\n\n");
	}
}

void addVertices(std::ofstream& obj)
{
	for(int i = 0; i < (HEIGHT+1)*(WIDTH+1); i++)
	{
		obj << "v " << std::to_string(i % (WIDTH+1)) << ".0 " << std::to_string(i / (WIDTH+1)) << ".0 0.0\n"; 
	}
	for(int i = 0; i < HEIGHT*WIDTH; i++)
	{
		for(int c = 0; c < 4; c++)
		{
			//Clockwise order
			int x = (c == 0 || c == 3 ? 0 : 1);
			int y = c / 2;
			
			obj << "v " << std::to_string(i % WIDTH + x) << ".0 " << std::to_string(i / WIDTH + y) << ".0 " << std::to_string(map[i / WIDTH][i % WIDTH]) << "\n";
		} 
	}
}

void addFaces(std::ofstream& obj)
{
	for(int i = 1; i <= HEIGHT*WIDTH; i++)
	{
		int roofIndex = 1 + (WIDTH+1)*(HEIGHT+1) + 4*( WIDTH*((i-1)/(WIDTH+1)) + (i-1)%(WIDTH+1) );
		
		int indices[3];
		
		for(int t = 0; t < 12; t++)
		{
			switch(t)
			{
			case 0:
				indices[0] = roofIndex;
				indices[1] = i;
				indices[2] = i+WIDTH+1;
				break;
			case 1:
				indices[0] = roofIndex;
				indices[1] = i+WIDTH+1;
				indices[2] = roofIndex+3;
				break;
			case 2:
				indices[0] = roofIndex+3;
				indices[1] = i+WIDTH+1;
				indices[2] = i+WIDTH+2;
				break;
			case 3:
				indices[0] = roofIndex+3;
				indices[1] = i+WIDTH+2;
				indices[2] = roofIndex+2;
				break;
			
			case 4:
				indices[0] = roofIndex+2;
				indices[1] = i+WIDTH+2;
				indices[2] = i+1;
				break;
			case 5:
				indices[0] = roofIndex+2;
				indices[1] = i+1;
				indices[2] = roofIndex+1;
				break;
			case 6:
				indices[0] = roofIndex+1;
				indices[1] = i+1;
				indices[2] = i;
				break;
			case 7:
				indices[0] = roofIndex+1;
				indices[1] = i;
				indices[2] = roofIndex;
				break;
			
			case 8:
				indices[0] = roofIndex+1;
				indices[1] = roofIndex;
				indices[2] = roofIndex+3;
				break;
			case 9:
				indices[0] = roofIndex+1;
				indices[1] = roofIndex+3;
				indices[2] = roofIndex+2;
				break;
			case 10:
				indices[0] = i+WIDTH+2;
				indices[1] = i+WIDTH+1;
				indices[2] = i;
				break;
			case 11:
				indices[0] = i+WIDTH+2;
				indices[1] = i;
				indices[2] = i+1;
				break;
			}
			obj << "f " << std::to_string(indices[0]) << " " << std::to_string(indices[1]) << " " << std::to_string(indices[2]) << "\n";
		}
	}
}

